import java.util.Scanner;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

public class App1 {

    public static void main(String[] args) {
		Scanner scan = new Scanner(System.in);
		System.out.println("Enter your student number: ");
		String input = scan.nextLine();
		Pattern format = Pattern.compile("[0-9]{4}-[0-9]{2}-[0-9]{3}");
		Matcher matcher = format.matcher(input);
		boolean matches = matcher.find();
		if (matches) {
			System.out.println("You have successfully logged in. \nWelcome to your new dashboard!\n");
			System.out.println("Student Number: " + input);
		} else {
			System.out.println("Invalid input. Please enter a valid Student number.\nExample: 1234-12-123");
		}
    }
}

