using namespace std;
using filesystem::path;

path operator""_p(const char* data, std::size_t sz) {
    return path(data, data + sz);
}

static regex reg1(R"?(\s*#\s*include\s*"([^"]*)"\s*)?");
static regex reg2(R"?(\s*#\s*include\s*<([^>]*)>\s*)?");

bool Preprocess(const path& in_file, const path& out_file, const vector<path>& include_directories);

void ReadWrite(ofstream& out, const path& out_file, const path& in_path, string in_filename, const vector<path>& include_directories) {
    smatch m;
    string line;
    size_t line_n = 1;
    bool find;

    ifstream in(in_path);

    while (getline(in, line)) {
        if (regex_match(line, m, reg1)) {
            path search_parent_path = in_path.parent_path() / path(string(m[1]));
            if (Preprocess(search_parent_path, out_file, include_directories)) {
                find = true;
                break;
            }
            else {
                for (const auto p : include_directories) {
                    path search_path = p / path(string(m[1]));
                    if (Preprocess(search_path, out_file, include_directories)) {
                        find = true;
                        break;
                    }
                }
            }
            cout << "unknown include file " << path(string(m[1])).filename().string() << " at file "
                << in_filename << "at line" << line_n << endl;
            find = false;
            break;
        }
        else if (regex_match(line, m, reg2)) {
            for (const auto p : include_directories) {
                path search_path = p / path(string(m[1]));
                if (Preprocess(search_path, out_file, include_directories)) {
                    find = true;
                    break;
                }
            }
            cout << "unknown include file " << path(string(m[1])).filename().string() << " at file "
                << in_filename << " at line " << line_n << endl;
            find = false;
            break;
        }
        else {
            out << line << endl;
            ++line_n;
        }
    }
}

//   
bool Preprocess(const path& in_file, const path& out_file, const vector<path>& include_directories) {
    ifstream in(in_file);

    if (!in) {
        return false;
    }

    ofstream out(out_file, ios_base::app);

    ReadWrite(out, out_file, in_file, in_file.string(), include_directories);
}

string GetFileContents(string file) {
    ifstream stream(file);

    //  string   
    return { (istreambuf_iterator<char>(stream)), istreambuf_iterator<char>() };
}

void Test() {
    error_code err;
    filesystem::remove_all("sources"_p, err);
    filesystem::create_directories("sources"_p / "include2"_p / "lib"_p, err);
    filesystem::create_directories("sources"_p / "include1"_p, err);
